import { Route } from "react-router-dom";

import FavoritePage from "./pages/Favorite";
import NewMeetupPage from "./pages/NewMeetup";
import AllMeetupsPage from "./pages/AllMeetups";

function App() {
  return (
    <>
      <Route path="/">
        <AllMeetupsPage />
      </Route>
      <Route path="/new-meetup">
        <NewMeetupPage />
      </Route>
      <Route path="/favorites">
        <FavoritePage />
      </Route>
    </>
  );
}

export default App;
